import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import { AccessibilityProvider } from "./context/AccessibilityContext";

ReactDOM.render(
  <AccessibilityProvider>
    <App />
  </AccessibilityProvider>,
  document.getElementById("root")
);
